Mi amigo Moises estaba durmiendo en la vieja cabana, deseando solamente un poco de tranquilidad, cuando me aparezco con la impresionante Domino, una maquina de follar del este de Europa con tremendo par de tetas naturales. Cuando Moe vio esa mujerona tatuada, se olvido que estaba cansado y se puso a trabajar follando le esas tetongas tan ricas!! Enjoy!
